// SourceList.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

function SourceList() {
  const [sources, setSources] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchSources();
  }, []);

  const fetchSources = async () => {
    try {
      const response = await axios.get('/api/v1/sources/', {
        headers: {
          'x-user-token': 'YOUR_USER_TOKEN', // Replace with actual user token
          'Authorization': 'Bearer YOUR_AUTH_TOKEN' // Replace with actual auth token
        }
      });
      setSources(response.data);
    } catch (err) {
      setError('Failed to fetch sources');
      console.error('Error fetching sources:', err);
    }
  };

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <h2>Source List</h2>
      <ul>
        {sources.map(source => (
          <li key={source.source}>
            <Link to={`/source/${source.source}`}>{source.source}</Link>
            <p>{source.description}</p>
          </li>
        ))}
      </ul>
      <Link to="/create-source">Create New Source</Link>
    </div>
  );
}

export default SourceList;
